@testset "Welz Problems" begin
    (a, b, c, d, k, p, q, x, ) = @variables a b c d k p q x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Martin*Welz - posts*on*Sci.Math.Symbolic=#


    #= ::Section::Closed:: =#
    #=4*June*2010=#


    #= [x*(x^2 + 3)/(2*a^2 + b^2*(x^2 + 1))^(5/2)*log((sqrt(2)*x*sqrt(2*a^2 + b^2*(x^2 + 1)) - 2*x*a + b*(x^2 + 1))/x), x, 0, sqrt(2)*(43*a^6 + 63*b^2*a^4 + 33*b^4*a^2 + 5*b^6)*(atan(b*(x/sqrt(2*a^2 + b^2)))/(6*b^4*sqrt(2*a^2 + b^2)*(3*a^2 + b^2)^3)) + sqrt(2)*(sqrt(4*a^2 + b^2) + a)^3*(3*a*sqrt(4*a^2 + b^2) - 7*a^2 - 2*b^2)*(log(sqrt(2)*(sqrt(4*a^2 + b^2) - a)*sqrt(2*a^2 + b^2*(x^2 + 1)) + b*x*sqrt(4*a^2 + b^2) + 2*a^2 - 2*b*x*a + b^2)/(6*b^4*(3*a^2 + b^2)^3)) + sqrt(2)*(sqrt(4*a^2 + b^2) - a)^3*(3*a*sqrt(4*a^2 + b^2) + 7*a^2 + 2*b^2)*(log(sqrt(2)*(sqrt(4*a^2 + b^2) + a)*sqrt(2*a^2 + b^2*(x^2 + 1)) + b*x*sqrt(4*a^2 + b^2) - 2*a^2 + 2*b*x*a - b^2)/(6*b^4*(3*a^2 + b^2)^3)) - (4*a^2 + b^2*(3*x^2 + 5))*(log((sqrt(2)*x*sqrt(2*a^2 + b^2*(x^2 + 1)) - 2*x*a + b*(x^2 + 1))/x)/(3*b^4*(2*a^2 + b^2*(x^2 + 1))^(3/2))) - (4*a^2 + 5*b^2)*(log((sqrt(2*a^2 + b^2*(x^2 + 1)) - sqrt(2*a^2 + b^2))/x)/(3*b^4*(2*a^2 + b^2)^(3/2))) + sqrt(2)*(2*a^2 + b^2)*(log(sqrt(2*a^2 + b^2*(x^2 + 1)) - sqrt(2)*a)/(6*b^4*a^3)) - sqrt(2)*(5*a^2 + b^2)*(8*a^6 + 9*b^2*a^4 + 6*b^4*a^2 + b^6)*(log(2*a^2 + b^2*(x^2 + 1))/(12*b^4*a^3*(3*a^2 + b^2)^3)) + sqrt(2)*(b^2 - a^2)*((sqrt(2)*sqrt(2*a^2 + b^2*(x^2 + 1))*(10*a^6 + 2*b*x*a^5 + 16*b^2*a^4 + 7*b^4*a^2 + b^6) + 12*a^7 + 6*b*x*a^6 + 16*b^2*a^5 + 5*b^3*x*a^4 + 7*b^4*a^3 + b^5*x*a^2 + b^6*a)/(6*b^4*a^2*(2*a^2 + b^2)*(2*a^2 + b^2*(x^2 + 1))*(3*a^2 + b^2)^2))] =#

    #= The*following*two*integrands*are*equivalent! =#
    @test_int [1/sqrt(1 - a*x), x, 1, -((2*sqrt(1 - a*x))/a)]
    @test_int [(log(a*x - 1) - 2*log(-sqrt(a*x - 1)))/(2*pi*sqrt(a*x - 1)), x, 5, -((2*sqrt(1 - a*x))/a), -((2*sqrt(-1 + a*x)*log(-sqrt(-1 + a*x)))/(a*pi)) + (sqrt(-1 + a*x)*log(-1 + a*x))/(a*pi)]


    #= ::Section::Closed:: =#
    #=6*June*2010=#


    #= [sqrt(b^2*x^2 + 2*a^2 + b^2)/(b^3*x^4 + 4*a*b^2*x^3 + 2*a^2*b*x^2 + 4*a*x*(2*a^2 + b^2) - b*(2*a^2 + b^2)), x, 0, 0]
    @test_int [sqrt(b^2*x^2 + 2*a^2 + b^2)/(b^3*x^6 + 4*a*b^2*x^5 + b*x^4*(2*a^2 + b^2) + 8*a*x^3*(a^2 + b^2) - b^3*x^2 + 4*a*x*(2*a^2 + b^2) - b*(2*a^2 + b^2)), x, 0, 0]
    @test_int [x/((b^2*x^2 + 2*a^2 + b^2)*((b*x^2 - 2*a*x + b)*sqrt(b^2*x^2 + 2*a^2 + b^2) + sqrt(2)*b^2*x^3 + sqrt(2)*x*(2*a^2 + b^2))), x, 0, 0] =#


    #= ::Section::Closed:: =#
    #=20*June*2010=#


    #= ::Subsubsection::Closed:: =#
    #=Problem #1=#


    @test_int [1/(sqrt(x^2 + 1) + 2*x)^2, x, 9, (4*x)/(3*(1 - 3*x^2)) - (2*sqrt(1 + x^2))/(3*(1 - 3*x^2)) - atanh(sqrt(3)*x)/(3*sqrt(3)) + atanh((1/2)*sqrt(3)*sqrt(1 + x^2))/(3*sqrt(3))]


    #= ::Subsubsection::Closed:: =#
    #=Problem #2=#


    @test_int [1/(sqrt(x^2 - 1)*(3*x^2 - 4)^2), x, 3, (3*x*sqrt(-1 + x^2))/(8*(4 - 3*x^2)) + (5/16)*atanh(x/(2*sqrt(-1 + x^2)))]


    #= ::Subsubsection::Closed:: =#
    #=Problem #3=#


    @test_int [1/(2*sqrt(x) + sqrt(x + 1))^2, x, 8, 8/(9*(1 - 3*x)) - (4*sqrt(x)*sqrt(1 + x))/(3*(1 - 3*x)) - (8*asinh(sqrt(x)))/9 + (10/9)*atanh((2*sqrt(x))/sqrt(1 + x)) + (5/9)*log(1 - 3*x)]


    #= ::Subsubsection::Closed:: =#
    #=Problem #4=#


    @test_int [sqrt(x^2 - 1)/(x - im)^2, x, 6, sqrt(-1 + x^2)/(im - x) - (im*atan((1 - im*x)/(sqrt(2)*sqrt(-1 + x^2))))/sqrt(2) + atanh(x/sqrt(-1 + x^2))]


    #= ::Subsubsection::Closed:: =#
    #=Problem #5=#


    @test_int [1/(sqrt(x^2 - 1)*(x^2 + 1)^2), x, 3, -((x*sqrt(-1 + x^2))/(4*(1 + x^2))) + (3*atanh((sqrt(2)*x)/sqrt(-1 + x^2)))/(4*sqrt(2))]


    #= ::Subsubsection::Closed:: =#
    #=Problem #6=#


    @test_int [1/(sqrt(x - 1)*(sqrt(x - 1) + sqrt(x))^2), x, 4, 2*sqrt(-1 + x) + (4/3)*(-1 + x)^(3/2) - (4*x^(3/2))/3]


    #= ::Subsubsection::Closed:: =#
    #=Problem #7=#


    @test_int [1/(sqrt(x^2 - 1)*(sqrt(x^2 - 1) + sqrt(x))^2), x, -18, (2 - 4*x)/(5*(sqrt(x) + sqrt(-1 + x^2))) + (1/25)*sqrt(-110 + 50*sqrt(5))*atan((1/2)*sqrt(2 + 2*sqrt(5))*sqrt(x)) - (1/50)*sqrt(-110 + 50*sqrt(5))*atan((sqrt(-2 + 2*sqrt(5))*sqrt(-1 + x^2))/(2 - (1 - sqrt(5))*x)) - (1/25)*sqrt(110 + 50*sqrt(5))*atanh((1/2)*sqrt(-2 + 2*sqrt(5))*sqrt(x)) - (1/50)*sqrt(110 + 50*sqrt(5))*atanh((sqrt(2 + 2*sqrt(5))*sqrt(-1 + x^2))/(2 - x - sqrt(5)*x))]


    @test_int [(sqrt(x) - sqrt(-1 + x^2))^2/((1 + x - x^2)^2*sqrt(-1 + x^2)), x, -25, (2 - 4*x)/(5*(sqrt(x) + sqrt(-1 + x^2))) + (1/25)*sqrt(-110 + 50*sqrt(5))*atan((1/2)*sqrt(2 + 2*sqrt(5))*sqrt(x)) - (1/50)*sqrt(-110 + 50*sqrt(5))*atan((sqrt(-2 + 2*sqrt(5))*sqrt(-1 + x^2))/(2 - (1 - sqrt(5))*x)) - (1/25)*sqrt(110 + 50*sqrt(5))*atanh((1/2)*sqrt(-2 + 2*sqrt(5))*sqrt(x)) - (1/50)*sqrt(110 + 50*sqrt(5))*atanh((sqrt(2 + 2*sqrt(5))*sqrt(-1 + x^2))/(2 - x - sqrt(5)*x))]


    @test_int [1/(sqrt(2)*(1 + x)^2*sqrt(-im + x^2)) + 1/(sqrt(2)*(1 + x)^2*sqrt(im + x^2)), x, 7, -(((1/2 + im/2)*sqrt(-im + x^2))/(sqrt(2)*(1 + x))) - ((1/2 - im/2)*sqrt(im + x^2))/(sqrt(2)*(1 + x)) + atanh((im + x)/(sqrt(1 - im)*sqrt(-im + x^2)))/((1 - im)^(3/2)*sqrt(2)) - atanh((im - x)/(sqrt(1 + im)*sqrt(im + x^2)))/((1 + im)^(3/2)*sqrt(2))]


    #= ::Subsubsection::Closed:: =#
    #=Problem #8=#


    @test_int [sqrt(sqrt(x^4 + 1) + x^2)/((x + 1)^2*sqrt(x^4 + 1)), x, 7, -(sqrt(1 - im*x^2)/(2*(1 + x))) - sqrt(1 + im*x^2)/(2*(1 + x)) - (1/4)*(1 - im)^(3/2)*atanh((1 + im*x)/(sqrt(1 - im)*sqrt(1 - im*x^2))) - (1/4)*(1 + im)^(3/2)*atanh((1 - im*x)/(sqrt(1 + im)*sqrt(1 + im*x^2)))]
    @test_int [sqrt(sqrt(x^4 + 1) + x^2)/((x + 1)*sqrt(x^4 + 1)), x, 5, (-(1/2))*sqrt(1 - im)*atanh((1 + im*x)/(sqrt(1 - im)*sqrt(1 - im*x^2))) - (1/2)*sqrt(1 + im)*atanh((1 - im*x)/(sqrt(1 + im)*sqrt(1 + im*x^2)))]
    @test_int [sqrt(sqrt(x^4 + 1) + x^2)/sqrt(x^4 + 1), x, 2, atanh((sqrt(2)*x)/sqrt(x^2 + sqrt(1 + x^4)))/sqrt(2)]
    @test_int [sqrt(sqrt(x^4 + 1) - x^2)/sqrt(x^4 + 1), x, 2, atan((sqrt(2)*x)/sqrt(-x^2 + sqrt(1 + x^4)))/sqrt(2)]


    #= ::Subsubsection::Closed:: =#
    #=Problem #9=#


    @test_int [((x - 1)^(3/2) + (x + 1)^(3/2))/((x + 1)^(3/2)*(x - 1)^(3/2)), x, 2, -(2/sqrt(-1 + x)) - 2/sqrt(1 + x)]


    #= ::Section::Closed:: =#
    #=15*August*2010=#


    @test_int [(x + sqrt(x^2 + a))^b, x, 3, -((a*(x + sqrt(a + x^2))^(-1 + b))/(2*(1 - b))) + (x + sqrt(a + x^2))^(1 + b)/(2*(1 + b))]
    @test_int [(x - sqrt(x^2 + a))^b, x, 3, -((a*(x - sqrt(a + x^2))^(-1 + b))/(2*(1 - b))) + (x - sqrt(a + x^2))^(1 + b)/(2*(1 + b))]
    @test_int [(x + sqrt(x^2 + a))^b/sqrt(x^2 + a), x, 2, (x + sqrt(a + x^2))^b/b]
    @test_int [(x - sqrt(x^2 + a))^b/sqrt(x^2 + a), x, 2, -((x - sqrt(a + x^2))^b/b)]


    @test_int [1/(a + b*ℯ^(p*x))^2, x, 3, 1/(a*(a + b*ℯ^(p*x))*p) + x/a^2 - log(a + b*ℯ^(p*x))/(a^2*p)]
    @test_int [1/(a*ℯ^(p*x) + b*ℯ^(-p*x))^2, x, 2, -(1/(2*a*(b + a*ℯ^(2*p*x))*p))]
    @test_int [x/(a*ℯ^(p*x) + b*ℯ^(-p*x))^2, x, 6, x/(2*a*b*p) - x/(2*a*(b + a*ℯ^(2*p*x))*p) - log(b + a*ℯ^(2*p*x))/(4*a*b*p^2)]


    #= ::Section::Closed:: =#
    #=2*September*2012=#


    #= ::Item:: =#
    #=Example*from*Welz's*paper "Two-term*Recurrence*Formulae*for*Indefinite*Algebraic*Integrals" available*at*https://arxiv.org/abs/1209.3758v2=#


    @test_int [(1 - x + 3*x^2)/((1 + x + x^2)^2*sqrt(1 - x + x^2)), x, 6, ((1 + x)*sqrt(1 - x + x^2))/(1 + x + x^2) + sqrt(2)*atan((sqrt(2)*(1 + x))/sqrt(1 - x + x^2)) - atanh((sqrt(2/3)*(1 - x))/sqrt(1 - x + x^2))/sqrt(6)]


    #= ::Section::Closed:: =#
    #=21*January*2013=#


    #= From*James*Davenport's*algint*package*documentation*for*Reduce =#
    @test_int [sqrt(x + sqrt(a^2 + x^2))/sqrt(a^2 + x^2), x, 2, 2*sqrt(x + sqrt(a^2 + x^2))]
    @test_int [sqrt(b*x + sqrt(a + b^2*x^2))/sqrt(a + b^2*x^2), x, 2, (2*sqrt(b*x + sqrt(a + b^2*x^2)))/b]


    @test_int [1/(x*sqrt(a^2 + x^2)*sqrt(x + sqrt(a^2 + x^2))), x, 5, -((2*atan(sqrt(x + sqrt(a^2 + x^2))/sqrt(a)))/a^(3/2)) - (2*atanh(sqrt(x + sqrt(a^2 + x^2))/sqrt(a)))/a^(3/2)]
    @test_int [sqrt(sqrt(a^2 + x^2) + x)/x, x, 6, 2*sqrt(x + sqrt(a^2 + x^2)) - 2*sqrt(a)*atan(sqrt(x + sqrt(a^2 + x^2))/sqrt(a)) - 2*sqrt(a)*atanh(sqrt(x + sqrt(a^2 + x^2))/sqrt(a))]


    #= ::Section::Closed:: =#
    #=17*September*2014=#


    @test_int [x^3*log(2 + x)^3*log(3 + x), x, 359, -((302177*x)/1152) + (8029*x^2)/2304 - (763*x^3)/3456 + (3*x^4)/256 + (377/64)*(2 + x)^2 - (71/216)*(2 + x)^3 + (3/256)*(2 + x)^4 + (2069/144)*log(2 + x) - (187/64)*x^2*log(2 + x) + (83/288)*x^3*log(2 + x) - (3/128)*x^4*log(2 + x) + (6733/32)*(2 + x)*log(2 + x) - (377/32)*(2 + x)^2*log(2 + x) + (71/72)*(2 + x)^3*log(2 + x) - (3/64)*(2 + x)^4*log(2 + x) - (43/12)*log(2 + x)^2 - (17/48)*x^3*log(2 + x)^2 + (3/64)*x^4*log(2 + x)^2 - (1251/16)*(2 + x)*log(2 + x)^2 + (273/32)*(2 + x)^2*log(2 + x)^2 - (3/4)*(2 + x)^3*log(2 + x)^2 + (3/64)*(2 + x)^4*log(2 + x)^2 + (65/4)*(2 + x)*log(2 + x)^3 - (33/8)*(2 + x)^2*log(2 + x)^3 + (3/4)*(2 + x)^3*log(2 + x)^3 - (1/16)*(2 + x)^4*log(2 + x)^3 + (3891/128)*log(3 + x) - (115/48)*x^2*log(3 + x) + (37/144)*x^3*log(3 + x) - (3/128)*x^4*log(3 + x) + (415/12)*(3 + x)*log(3 + x) - (4083/32)*log(2 + x)*log(3 + x) - 25*x*log(2 + x)*log(3 + x) + (13/4)*x^2*log(2 + x)*log(3 + x) - (7/12)*x^3*log(2 + x)*log(3 + x) + (3/32)*x^4*log(2 + x)*log(3 + x) + (963/16)*log(2 + x)^2*log(3 + x) + 6*x*log(2 + x)^2*log(3 + x) - (3/2)*x^2*log(2 + x)^2*log(3 + x) + (1/2)*x^3*log(2 + x)^2*log(3 + x) - (3/16)*x^4*log(2 + x)^2*log(3 + x) - (81/4)*log(2 + x)^3*log(3 + x) + (1/4)*x^4*log(2 + x)^3*log(3 + x) - (5609/96)*PolyLog(2, -2 - x) + (563/8)*log(2 + x)*PolyLog(2, -2 - x) - (195/4)*log(2 + x)^2*PolyLog(2, -2 - x) - (563/8)*PolyLog(3, -2 - x) + (195/2)*log(2 + x)*PolyLog(3, -2 - x) - (195/2)*PolyLog(4, -2 - x)]


    #= ::Section::Closed:: =#
    #= 12*January*2016=#


    @test_int [(sqrt(x^2 + b) + x)^a/sqrt(x^2 + b), x, 2, (x + sqrt(b + x^2))^a/a]


    @test_int [(sqrt(x^2 + b) + x)^a, x, 3, -((b*(x + sqrt(b + x^2))^(-1 + a))/(2*(1 - a))) + (x + sqrt(b + x^2))^(1 + a)/(2*(1 + a))]


    @test_int [(x^(3*a) + x^(2*a) + x^a)*(2*x^(2*a) + 3*x^a + 6)^(1/a), x, 2, (x^(1 + a)*(6 + 3*x^a + 2*x^(2*a))^(1 + 1/a))/(6*(1 + a))]


    @test_int [1/(x*(1 - x^2)^(1/3)), x, 5, (1/2)*sqrt(3)*atan((1 + 2*(1 - x^2)^(1/3))/sqrt(3)) - log(x)/2 + (3/4)*log(1 - (1 - x^2)^(1/3))]


    @test_int [1/(x*(1 - x^2)^(2/3)), x, 5, (-(1/2))*sqrt(3)*atan((1 + 2*(1 - x^2)^(1/3))/sqrt(3)) - log(x)/2 + (3/4)*log(1 - (1 - x^2)^(1/3))]


    @test_int [1/(1 - x^3)^(1/3), x, 1, -(atan((1 - (2*x)/(1 - x^3)^(1/3))/sqrt(3))/sqrt(3)) + (1/2)*log(x + (1 - x^3)^(1/3))]


    @test_int [1/(x*(1 - x^3)^(1/3)), x, 5, atan((1 + 2*(1 - x^3)^(1/3))/sqrt(3))/sqrt(3) - log(x)/2 + (1/2)*log(1 - (1 - x^3)^(1/3))]


    @test_int [1/((1 + x)*(1 - x^3)^(1/3)), x, 1, -((sqrt(3)*atan((1 + (2^(1/3)*(1 - x))/(1 - x^3)^(1/3))/sqrt(3)))/(2*2^(1/3))) - log((1 - x)*(1 + x)^2)/(4*2^(1/3)) + (3*log(-1 + x + 2^(2/3)*(1 - x^3)^(1/3)))/(4*2^(1/3))]


    @test_int [x/((1 + x)*(1 - x^3)^(1/3)), x, 3, (sqrt(3)*atan((1 + (2^(1/3)*(1 - x))/(1 - x^3)^(1/3))/sqrt(3)))/(2*2^(1/3)) - atan((1 - (2*x)/(1 - x^3)^(1/3))/sqrt(3))/sqrt(3) + log((1 - x)*(1 + x)^2)/(4*2^(1/3)) + (1/2)*log(x + (1 - x^3)^(1/3)) - (3*log(-1 + x + 2^(2/3)*(1 - x^3)^(1/3)))/(4*2^(1/3))]


    @test_int [1/(x*(x^2 - 3*x + 2)^(1/3)), x, -2, -((sqrt(3)*atan(1/sqrt(3) + (2^(1/3)*(2 - x))/(sqrt(3)*(2 - 3*x + x^2)^(1/3))))/(2*2^(1/3))) - log(2 - x)/(4*2^(1/3)) - log(x)/(2*2^(1/3)) + (3*log(2 - x - 2^(2/3)*(2 - 3*x + x^2)^(1/3)))/(4*2^(1/3))]


    @test_int [1/(x^3 - 3*x^2 + 7*x - 5)^(1/3), x, -5, (1/2)*sqrt(3)*atan(1/sqrt(3) + (2*(-1 + x))/(sqrt(3)*(-5 + 7*x - 3*x^2 + x^3)^(1/3))) + (1/4)*log(1 - x) - (3/4)*log(1 - x + (-5 + 7*x - 3*x^2 + x^3)^(1/3))]


    @test_int [1/(x*(x^2 - q))^(1/3), x, -5, (1/2)*sqrt(3)*atan(1/sqrt(3) + (2*x)/(sqrt(3)*(x*(-q + x^2))^(1/3))) + log(x)/4 - (3/4)*log(-x + (x*(-q + x^2))^(1/3))]


    @test_int [1/((x - 1)*(x^2 - 2*x + q))^(1/3), x, -5, (1/2)*sqrt(3)*atan(1/sqrt(3) + (2*(-1 + x))/(sqrt(3)*((-1 + x)*(q - 2*x + x^2))^(1/3))) + (1/4)*log(1 - x) - (3/4)*log(1 - x + ((-1 + x)*(q - 2*x + x^2))^(1/3))]


    @test_int [1/(x*((x - 1)*(x^2 - 2*q*x + q))^(1/3)), x, -2, (sqrt(3)*atan(1/sqrt(3) + (2*q^(1/3)*(-1 + x))/(sqrt(3)*((-1 + x)*(q - 2*q*x + x^2))^(1/3))))/(2*q^(1/3)) + log(1 - x)/(4*q^(1/3)) + log(x)/(2*q^(1/3)) - (3*log((-q^(1/3))*(-1 + x) + ((-1 + x)*(q - 2*q*x + x^2))^(1/3)))/(4*q^(1/3))]


